import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
    Paper: {
        borderTopColor: 'rgb(175,171, 171)',
        borderTopWidth: '15px',
    },
    container: {

        flexGrow: 1,
        margin: 0,
        padding: 0
    },
    root: {
        '& > *': {
            margin: theme.spacing(1),
            color: 'white',
            bordertop: '1px white solid',
            background: 'rgb(32,42, 59)',
            height: '300px',

            color: 'white',
            padding: '0px',
        },
    },
}));



export default function Box(props) {
    const classes = useStyles();
    console.log(props);
    return (

        <div className={classes.root}>
            <Paper className={classes.Paper} elevation={24} variant="outlined" square >


                <Grid className={classes.container} direction="column" justify="center" alignItems="center" container spacing={1}>
                    <Grid item xs={3} className={classes.item}  >
                        <div>Classes d'actifs</div>
                    </Grid>
                    <Grid item xs={3} className={classes.item}  >
                        <div>{props.content}</div>
                    </Grid>
                </Grid>
            </Paper>
        </div >
    );
}
